    for i in range(n - 1, -1, -1):
        for j in range(k):
            (maa, ele) = (0, a[j][i])
            for m in range(k):
                if b[m][ele] < i:
                    break
            else:
                for l in range(b[j][ele] + 1, n):
                    ma = 0
                    for m in range(k):
                        if b[m][ele] > b[m][a[j][l]]:
                            break
                        ma = max(ma, dp[m][b[m][a[j][l]]])
                    else:
                        maa = max(maa, ma)
                dp[j][i] = maa + 1
    return max((max(i) for i in dp))

